const reset = async () => {
  try {
    console.log('Waiting for 2000 milliseconds...');
    await new Promise((r) => setTimeout(r, 2000)); // wait for MySQL connection
    console.log('Connection established. Disabling foreign key checks.');
    await zeroParamPromise('SET FOREIGN_KEY_CHECKS = 0');

    console.log('Truncating the student table.');
    await zeroParamPromise('TRUNCATE TABLE student');
    console.log('Student table truncated.');

    console.log('Enabling foreign key checks.');
    await zeroParamPromise('SET FOREIGN_KEY_CHECKS = 1');

    // Insert student data
    for (let i = 0; i < studentsData.length; ++i) {
      try {
        console.log(`Inserting data for student: ${studentsData[i].s_name}`);
        const hashedPassword = await bcrypt.hash(studentsData[i].dob, 8);
        const currentStudent = {
          s_id: uuidv4(),
          ...studentsData[i],
          password: hashedPassword,
        };
        await queryParamPromise('INSERT INTO student SET ?', currentStudent);
        console.log(`Student data inserted: ${studentsData[i].s_name}`);
      } catch (insertError) {
        console.error(`Error inserting data for student: ${studentsData[i].s_name}`, insertError);
        throw insertError;
      }
    }

    console.log('Student data added successfully.');
  } catch (err) {
    console.error('Error in the reset function:', err);
  } finally {
    console.log('Exiting the process.');
    process.exit();
  }
};

// Immediately Invoked Function Expression (IIFE)
(async () => {
  await reset();
})();